INSERT INTO kaob.memory (id, user_id, title, text, timestamp) VALUES (1, 1, 'Unistuste nukk', e'Üles kasvades ei olnud meil palju raha, pigem lausa vastupidi, tulime vaevu ots-otsaga kokku nii et mingisugust luksust me endale lubada ei saanud. Olin sellega harjunud ja mind isegi ei häirinud, kui teistel olid uuemad rõivad või mänguasjad. Olin õnnelik isegi selle üle, kui ema mu aeg-ajalt mänguasja kauplusesse viis ja ma sain seal lihtsalt ringi vaadata. Kuid siis nägin ma ühte nukku – ta sulges pikali olles silmad ja seljale patsutades ütles piiksuva häälega „Ma-ma“. Vaatasin emale otsa, kuid ei söandanud küsida. Ema naeratas nukralt, paitas mu pead ja me läksime koju.
